//TODO: export dictionary as array from sepearate h/cpp file

VRType GetTagVR(const Tag& a_tag) {
    static const size_t dict_size = sizeof(TagDictionary) / sizeof(TagDictionary[0]);
    auto* dict_begin = TagDictionary;
    auto* dict_end   = TagDictionary + dict_size;
    auto find_it = std::lower_bound(dict_begin, dict_end, a_tag.m_solid, [](const TagDictItem& lhs, const unsigned int& rhs) {
        return lhs.m_number < rhs;
    });
    if (dict_end == find_it || find_it->m_number != a_tag.m_solid)
        return VRType::Undefined;
    //TODO: return all possible VRs
    return find_it->m_vr[0];
}

